#include <gtest/gtest.h>
#include "header.h"

using namespace std;

//leetcode submit region begin(Prohibit modification and deletion)
class Solution {
public:
    string originalDigits(string s) {
        int _size = s.size();
        unordered_map<char, int> ma;
        for (auto it: s) {
            ma[it]++;
        }
        int times = 0;
        string res;
        vector<int> a = {0, 8, 6, 3, 2, 7, 5, 9, 4, 1};
        for (auto it: vector<string>{"zero", "eight", "six", "three", "two", "seven", "five", "nine", "four", "one"}) {
            int flag = 1 << 30;
            for (auto i: it) {
                if (ma.count(i) == 0) {
                    flag = 0;
                } else {
                    flag = min(flag, ma[i]);
                }
            }
            if (flag) {
                res += string(flag, '0' + a[times]);
                for (auto i: it) {
                    ma[i] -= flag;
                    if (ma[i] == 0) {
                        ma.erase(i);
                    }

                }
            }
            times++;
            // times %= 10;
        }
        sort(res.begin(), res.end());

        return res;

    }
};

//leetcode submit region end(Prohibit modification and deletion)


namespace {
    TEST(ReconstructOriginalDigitsFromEnglish, Example1) {      // NOLINT
        // std::vector<int> nums = {};
        string nums = "";
        auto ans = Solution().originalDigits(nums);
        decltype(ans) rightAns = "";
        ASSERT_EQ(ans, rightAns);
    }

}


